    def regular(string: str) -> bool:
        opened = 0
        for c in string:
            if c == '(':
                opened += 1
            elif opened > 0:
                opened -= 1
            else:
                return False
        return opened == 0
    for t in transformations:
        if regular(a.replace('A', t[0]).replace('B', t[-1]).replace('C', t[2])):
            return True
    return False

